    return (
        <div className='bg-gray'>
        <div className='home-section'>
          <h2 className='nav-h2'>Welcome back, Deion</h2>

          <div>


              <Link to="/Trivia1">
            <div className='pill'>
              <p>Trivia</p>
            </div>
              </Link>
          </div>
        </div>
        </div>
    );
  };

  export default Trivia1;
